import React from 'react';
import './MapView.css';

const MapView = () => {
  return (
    <div className="map-view">
      <h2>Incident Map View</h2>
      <input type="text" placeholder="Search by keyword" />
      <p>[Map with incident markers]</p>
    </div>
  );
};

export default MapView;
